function Button({ children, version, type, isDisabled }) {
    return (
        <button type={type} disbled={isDisabled} className={'btn btn-${version}'}>
            {children}
        </button>
    )
}

Button.defaultProps = {
    version: 'primary',
    type: 'button',
    isDisabled: false
}


export default Button
